    console.log("Button clicked");
    setCreating(true);
  };

  console.log("Rendering GamesPage, startCreateGameHandler:", startCreateGameHandler);

  return (
    <React.Fragment>
      {/* ... other code ... */}
      <div className="games-control">
        <p>Share your own events!</p>
        <button 
          className="btn" 
          onClick={startCreateGameHandler}
          type="button"
